import React, { Component } from 'react'

export default class SignUp extends Component {

constructor(props) {
    super();
    this.state = {
        email:'',
        password:''
    }
}

    render() {
        return (
            <div className='signup-form'>

            <form>
            <div>
            <h1>SignUp Page</h1>
            </div>
            <input type='email'></input> Enter Your email
            <input type='password'></input>Enter your password
            <button type='submit'>SignUp</button>
            </form>

            </div>
        )
    }
}
